import React, { Component }  from 'react';
import PropTypes from 'prop-types';

class Map extends Component {
    
    componentDidMount() {
        this._getMap();
    }
    
    _getMap  = () => {
        const map = new Tmapv2.Map("map_div", { // 지도가 생성될 div
			width : "100%", // 지도의 넓이
			height : "400px" // 지도의 높이
		});
    }

    render() {
        return (
        <div className="map_div"></div>
        )
    };
}

export default Map;
